import React from 'react'

const Contact = () => {
  return (
    <div>
        <h1> Hoto Movie Creator Contact Info: </h1>
        <p> Alan To Contact Info: alantofus@gmail.com </p>
        <p> Justin Ho Contact Info: justinho@uw.edu </p>
    </div>
  )
}

export default Contact
